import "./App.css";

import Navbar from "./components/Navbar";
import Karte from "./components/Karte";
import Searchbar from "./components/Searchbar";

function App() {
  return (
    <>
      <Searchbar />
      <Navbar />
      <Karte />
    </>
  );
}

export default App;
